import React from 'react';
import styled from 'styled-components';

const Side1 = styled.div(
  props => `
  transform: rotate3d(1, 1, 1, ${props.xVal}deg);
`
);

const CubeSide1 = ({ xVal, yVal, zVal }) => {
  return (
    <Side1>
      <div className='side1'></div>
    </Side1>
  );
};

export default CubeSide1;
